export const Input=styled.input`
    /* padding:0 2rem 0 2rem; */

    padding: 0.5em;
    margin: 0.5em;
    color: palevioletred;
    background: papayawhip;
    border: none;
    border-radius: 3px;
    /* &:focus{
        border: 3px solid #555;
    } */
`
